     }
    render() { 
        return ( 
            <div>
                <h1>Login page</h1>
                <form>
                    <label>Email
                    <input type="text" />
                    </label>
                    <br />
                    <label>Password
                    <input type="password" />
                    </label>
                    <button>Login</button>
                </form>
            </div>
         );
    }
}

export default LoginPage;
